import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    items: [
      { id: 1, name: 'T-Shirts', image: 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Blue_Tshirt.jpg/220px-Blue_Tshirt.jpg', price: 200 },
      { id: 2, name: 'Leggings', image: 'data:image/jpeg;base64,', price: 400 },
      { id: 3, name: 'Slippers', image: 'https://static.hopscotch.in/fstatic/product/201811/7caffec8-5e78-4034-84b3-432c69c40c76_full.jpg?version=1541420661416&tr=w-720,c-at_max,n-normal', price: 2800 },
      { id: 4, name: 'Pants', image: 'https://image.uniqlo.com/UQ/ST3/WesternCommon/imagesgoods/414497/item/goods_08_414497.jpg?width=2000', price: 500 },
      { id: 5, name: 'Suits', image: 'https://sc02.alicdn.com/kf/UTB8P7QBhT_IXKJkSalUq6yBzVXax.jpg_350x350.jpg', price: 800 },
      { id: 6, name: 'Shirts', image: 'data:image/jpeg;base64,', price: 900 },
      { id: 7, name: 'Trousers', image: 'https://5.imimg.com/data5/EO/CP/MY-39654212/mens-trouser-500x500.jpg', price: 1000 },
      { id: 8, name: 'Dresses', image: 'data:image/jpeg;base64,', price: 1200 },
    ],
    inCart: []

  },

  getters: {

    items: state => state.items,
    inCart: state => state.inCart,

    totalPrice: state => {

      let total = 0;
      state.inCart.forEach(item => {
        total += item.product.price * item.quantity;
      })
      return total;
    }

  },

  actions: {

    addProductToCart(context, { product, quantity }) {
      context.commit('ADD_TO_CART', { product, quantity });
    },

    removeFromCart(context, index) {
      context.commit('REMOVE_FROM_CART', index);
    },





  },

  mutations: {
    ADD_TO_CART(state, { product, quantity }) {

      let productCart = state.inCart.find(item => {
        return item.product.id === product.id;
      })

      if (productCart) {

        productCart.quantity += quantity;
        return;
      }
      state.inCart.push({ product, quantity });

    },


    REMOVE_FROM_CART(state, index) {
      state.inCart.splice(index, 1);
    },


  }


})
